INSERT INTO `news` (`code`, `img`, `imgt`, `imgs`) VALUES
(1, , 'Egypt expresses sincere condolences to Bangladesh for victims of ferry fire', 'CAIRO - 26 December 2021: Egypt expressed, on Saturday, its sincere condolences and sympathies to the friendly People\'s Republic of Bangladesh over the victims of a ferry fire in the south of the country, which resulted in dozens of deaths and injuries.\r\n \r\n“Egypt also extends its condolences to the families of the victims and wishes a speedy recovery to all the injured. Egypt affirms its solidarity with the government and people of Bangladesh in this painful incident,\" the Egyptian Foreign Ministry said in a statement.\r\n \r\nAt least 38 people were killed and dozens of others were injured on Friday after a fire swept through a three-decked ferry that was carrying more than 500 people on board near the town of Jhalakathi, BBC reported on Saturday.');
INSERT INTO `news` (`code`, `img`, `imgt`, `imgs`) VALUES
(4, , 'In Pics: Fire in Alex waterfront restaurant controlled', 'CAIRO - 29 Septemebr 2021: Civil protection forces in Alexandria controlled a huge fire that broke out in a popular restaurant in Gleem on the Kornish along the Alexandria coastline.\r\n\r\n\r\nTraffic was partially diverted from the Kornish in Gleem to San Stefano so as not to disrupt morning rush hour.\r\n\r\nThe blaze covered the whole waterfront restaurant and three fire engines rushed to the scene to contain the flames.\r\n\r\nInvestigations on the reasons behind the fire are underway. ');
INSERT INTO `news` (`code`, `img`, `imgt`, `imgs`) VALUES
(5, , 'In pics: Huge fire at church in Giza under control, no casualties reported', 'CAIRO – 30 April 2021: A huge fire that broke out late on Friday at a church in Giza, known as the church of angel Suriel and Mar Mina, was brought under control without any casualties, the Giza Diocese said.\r\n\r\nThe Giza Diocese said the fire took place after the prayers and after worshippers left the place.\r\n\r\nThe civil protection department in Giza earlier announced sending eight fire engines to the scene to put out the fire.\r\n\r\nChristian people in Egypt and many other countries celebrated today the “Good Friday” and also the “Maundy Thursday” yesterday.\r\n\r\nPope Tawadros led the Maundy Thursday with no worshippers and the Good Friday with a limited attendance due to the rise in coronavirus cases.');
INSERT INTO `news` (`code`, `img`, `imgt`, `imgs`) VALUES
(6, , 'Prosecution detains man accused of burning shops in downtown Cairo pending investigation', 'CAIRO – 30 January 2021: The Egyptian Public Prosecution on Saturday ordered the detention of a man accused of burning down several shops in Tawfiqia market, one of the famous markets for car accessories, downtown Cairo on Friday, for 4 days pending investigation.\r\n\r\nOn Friday morning, a huge fire broke out through shops and buildings, causing losses reportedly estimated at millions of Egyptian pounds but leaving no casualties.\r\n\r\nFew hours after civil protection forces put out the fire, the accused man was arrested and confessed the crime, according to reports. A team of the Public Prosecution visited the scene to disclose the circumstances behind the fire.\r\n\r\nAccording to the prosecution’s Saturday statement, the accused man’s uncle and the latter’s son have confirmed their earlier testimonies, accusing the man of burning down the shops they own, along with other jobs, over a financial dispute.\r\n\r\nArrested by the prosecution, the accused man admitted that he set fire to the shops his uncle and first cousin own in retaliation over a financial dispute.\r\n\r\nThe prosecution said it could also obtain a video showing the accused man while carrying a bag with the fuel he used to commit his crime.\r\n\r\nAccording to the statement, the fire reached two buildings at Tawfiqia market street and two other buildings at Boursa street. It also extended to a shopping center in the area and a close building that is under construction as well as some other shops.');
INSERT INTO `news` (`code`, `img`, `imgt`, `imgs`) VALUES
(7, , 'Fire breaks out in pharmaceutical warehouse in downtown Cairo', 'CAIRO – 14 December 2021: A fire broke out in a pharmaceutical warehouse located in Abaseya neighborhood in downtown Cairo in the morning of Thursday. Currently, 10 fire engines are attempting to put it out.\r\n\r\n \r\n\r\nIn a similar context, the General Authority of Alexandria Port said in December a fire broke out at the second floor of a building at the Alexandria port in northern Egypt, and that 16 firefighting vehicles are dealing with the fire.\r\n\r\n \r\n\r\nThe fire has not caused any casualties, a statement by the authority read.\r\n\r\n \r\n\r\nThe area around the building has been evacuated, the statement read, affirming that no further blasts have happened due to the fire.');
INSERT INTO `news` (`code`, `img`, `imgt`, `imgs`) VALUES
(8, , 'Pics: Huge fire breaks out at market in UAE Ajman', 'CAIRO – 5 August 2020: A popular market in the new industrial zone in UAE’s Emirate of Ajman witnessed a huge fire on Wednesday, Emirati Al Bayan reported, adding that civil defense teams are trying to put out the fire.\r\n\r\n \r\n\r\nFirefighters and policemen moved to the site of the fire right away, according to the newspaper.\r\n\r\n \r\n\r\nAll the four centers of the civil defense teams are currently dealing with the fire, the civil defense administration said, adding that support will be sought from the neighboring emirates if necessary.');
INSERT INTO `news` (`code`, `img`, `imgt`, `imgs`) VALUES
